import React from 'react';


const DigitalClock=()=>{

    let Time= new Date().toTimeString()
    return(
        <>
             <div style={{ display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center' }}>
                 <h1>{Time}</h1>
             </div>
        </>
    )
}

export default DigitalClock;
